INSERT INTO `salud_archivo_conceptos_glosas` (`id_concepto_glosa`, `cod_glosa`, `cod_concepto_general`, `cod_concepto_especifico`, `descrpcion_concep_especifico`, `aplicacion`, `Updated`, `Sync`) VALUES
(1, 101, 1, 01, 'Estancia', '1. El cargo por estancia, en cualquier tipo de internación, que viene relacionado y/o justificado en los soportes de la factura, presenta diferencia con las cantidades que fueron facturadas. 2. El prestador de servicios de salud relaciona excedentes en estancia que la entidad responsable del pago no tiene que asumir de acuerdo con lo pactado por las partes.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(2, 102, 1, 02, 'Consultas, interconsultas y visitas médicas', '1. El cargo por consulta, interconsulta y/o visita\nmédica que viene relacionado y/o justificado en\nlos soportes de la factura, presenta diferencias\ncon las cantidades que fueron facturadas.\n2. En una factura se registra una interconsulta que\noriginó la práctica de una intervención o\nprocedimiento que realizó el mismo prestador.\n3. Se cobran consultas o visitas médicas que se\nencuentran incluidas en los honorarios médicos\nposquirúrgicos.\n4. Se cobran consultas y/o controles médicos que\nse encuentran incluidas en los honorarios médicos\ndel procedimiento del parto, según lo pactado\nentre las partes.\n5. El prestador de servicios de salud relaciona\nexcedentes en consultas, interconsultas y visitas\nmédicas que la entidad responsable del pago no\ntiene que asumir.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(3, 103, 1, 03, 'Honorarios médicos en procedimientos', '1. Los cargos por honorarios médicos en\nprocedimientos quirúrgicos, de hemodinamia,\nradiología u otros procedimientos que vienen\nrelacionados y/o justificados en los soportes de la\nfactura, presentan diferencias con las cantidades\nque fueron facturadas.\n2. Los cargos por honorarios de anestesia que\nvienen relacionados y/o justificados en los\nsoportes de la factura, presentan diferencias con\nlas cantidades que fueron facturadas.\n3. El prestador de servicios de salud relaciona\nexcedentes en honorarios médicos en\nprocedimientos que la entidad responsable del\npago no tiene que asumir', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(4, 104, 1, 04, 'Honorarios otros profesionales asistenciales', '1. Los cargos por honorarios de los profesionales en salud diferentes a los quirúrgicos y clínicos, que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con las cantidades facturadas. 2. El prestador de servicios de salud relaciona excedentes en honorarios de otros profesionales asistenciales que la entidad responsable del pago no tiene que asumir.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(5, 105, 1, 05, 'Derechos de sala', '1. Los cargos por derechos de sala que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con las cantidades que fueron facturadas. 2. El prestador de servicios de salud relaciona excedentes en derechos de sala que la entidad responsable del pago no tiene que asumir.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(6, 106, 1, 06, 'Materiales', '1. Los cargos por materiales que vienen relacionados en el detalle de cargos y/o los soportes, presentan diferencias con las cantidades que fueron facturadas. 2. Se cobran insumos que ya se encuentran incluidos en el ítem de materiales por grupo o atención integral. 3. El prestador de servicios de salud relaciona excedentes en materiales que la entidad responsable del pago no tiene que asumir', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(7, 107, 1, 07, 'Medicamentos', '1. Los cargos por medicamentos que vienen relacionados en el detalle de cargos y/o los soportes, presentan diferencias con las cantidades que fueron facturadas. 2. El prestador de servicios de salud relaciona excedentes en medicamentos que la entidad responsable del pago no tiene que asumir', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(8, 108, 1, 08, 'Ayudas diagnósticas', '1. Los cargos por ayudas diagnósticas (incluye procedimientos diagnósticos) que vienen relacionados y/o justificados en los soportes de la factura presentan diferencias con las cantidades que fueron facturadas. 2. De acuerdo con la tarifa pactada, se facturen separadamente ayudas diagnósticas incluidas una en otra.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(9, 109, 1, 09, 'Atención integral (caso, conjunto integral de atenciones, paquete o grupo relacionado diagnóstico)', 'El prestador de servicios de salud registra en la\nfactura cargos detallados que sobrepasan el valor\npactado por caso, conjunto integral de atenciones,\npaquete o grupo relacionado por diagnóstico.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(10, 110, 1, 10, 'Servicio o insumo incluido en caso, conjunto integral de atenciones, paquete o grupo relacionado por diagnóstico', 'El prestador de servicios de salud registra en la factura cargos adicionales que se encuentran incluidos en un procedimiento de atención integral de acuerdo con lo pactado', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(11, 111, 1, 11, 'Servicio o insumo incluido en estancia o derechos de sala', '1. Se cobran consultas, interconsultas y/o visitas médicas que están incluidas en las estancias de acuerdo con lo pactado. 2. Se cobran insumos que ya se encuentran incluidos en el ítem de derechos de sala o materiales quirúrgicos. 3. El prestador de servicios de salud registra en la factura actividades, procedimientos o servicios que se encuentran incluidos en la tarifa de la estancia de acuerdo con pactado.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(12, 112, 1, 12, 'Factura excede topes autorizados', 'La factura presenta excedentes sobre los topes establecidos previamente entre las partes, o excede el saldo disponible del contrato. No aplica en caso de atención inicial de urgencias o cuando se haya emitido autorización', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(13, 113, 1, 13, 'Facturar por separado por tipo de recobro (Comité Técnico Científico, (CTC), accidente de trabajo o enfermedad profesional (ATEP), tutelas)', 'Aplica cuando el prestador en una misma factura, registra servicios que previamente se ha pactado que se facturarán en forma independiente, como facturas de recobro por reaseguro, Comité técnico científico o tutelas.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(14, 114, 1, 14, 'Error en suma de conceptos facturados', 'Aplica cuando la sumatoria de los ítems\nregistrados en la factura presenta diferencias con\nlos subtotales o el total de los servicios\nfacturados, incluyendo los detalles de los soportes\ncomparados con los subtotales de la factura', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(15, 115, 1, 15, 'Datos insuficientes del usuario', 'Aplica cuando el prestador del servicio no\nrelaciona en la factura suficiente información del\nusuario al cual se le prestó el servicio (nombres,\napellidos, identificación, plan o programa, entre\notros) necesarios para el registro de información\npor parte de la entidad responsable del pago.\nAplica sólo cuando la factura incluye varios\npacientes y se puede tramitar parcialmente la\nfactura y se ha acordado contractualmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(16, 116, 1, 16, 'Usuario o servicio corresponde a otro plan o responsable', '1. En la factura se relacionan usuarios o servicios\nde los cuales uno o varios corresponden a otra\nentidad responsable y/o a otro plan de beneficios.\nNOTA: No se pueden relacionar en una misma\nfactura usuarios de diferentes planes de beneficio\n(POS y medicina prepagada o planes\ncomplementarios) así sea de la misma entidad\nresponsable del pago, los cuales deben ser\nfacturados en forma independiente.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(17, 117, 1, 17, 'Usuario retirado o moroso', 'Aplica cuando en la factura se relacionan usuarios\nque en el momento de la prestación del servicio\nno están cubiertos por la entidad responsable del\npago.\nAplica sólo cuando la factura incluye varios\npacientes y se puede tramitar parcialmente.\nNo aplica cuando la entidad responsable del pago\nha emitido la autorización de servicios, o cuando\nel afiliado acredite el derecho mediante la\npresentación del comprobante de descuento por\nparte del empleador.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(18, 119, 1, 19, 'Error en descuento pactado', 'Aplica cuando hay descuentos otorgados, que\nfueron aplicados de manera diferente a lo\npactado. Aplica sólo cuando se puede tramitar\nparcialmente la factura', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(19, 120, 1, 20, 'Recibo de pago compartido', '1. Los recaudos de bonos, periodos de carencia,\no vales que debe efectuar el prestador de\nservicios, no se realizan o quedan mal liquidados.\n2. Los recaudos de cuotas moderadoras, de\nrecuperación o copagos, que efectuó el\nprestación de servicios, quedan mal liquidados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(20, 122, 1, 22, 'Descripción dentro de los términos legales o pactados entre las partes', 'El prestador presenta el cobro de un servicio en\nfecha posterior a la establecida en la normatividad\nvigente o incumpliendo los términos de los\nacuerdos contractuales,', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(21, 123, 1, 23, 'Procedimiento o actividad', '1. Los cargos por procedimientos o actividades\nque vienen relacionados y/o justificados en los\nsoportes de la factura presentan diferencias con\nlas cantidades que fueron facturadas.\nDe acuerdo con la tarifa pactada, se facturen\nseparadamente procedimientos o actividades una\nen otra.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(22, 124, 1, 24, 'Falta firma del prestador de servicios de salud', '1. La factura no tiene la firma del prestador', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(23, 125, 1, 25, 'Examen o actividad pertenece a detección temprana y protección específica', 'Se factura una actividad de detección temprana\ny/o protección específica en una factura de\nservicios asistenciales y esta actividad hace parte\nde un paquete de servicios de prevención o\nprotección específica', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(24, 126, 1, 26, 'Usuario o servicio corresponde a capitación', 'Aplica cuando se factura por evento un servicio\nprestado a un usuario capitado. Aplica sólo\ncuando la factura incluye varios pacientes y se\npuede tramitar parcialmente', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(25, 127, 1, 27, 'Servicio de procedimiento incluido en otro', 'Aplica cuando se cobran servicios o\nprocedimientos que se encuentran incluidos en\notro servicio ya cobrado dentro de la misma u otra\nfactura.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(26, 128, 1, 28, 'Orden cancelada al prestador de servicios de salud', 'Aplica cuando el prestador de servicios de salud\nfactura un servicio ya cancelado en la factura o en\notra anterior por parte de la entidad responsable\ndel pago. Aplica sólo cuando la factura incluye\nvarios pacientes y se puede tramitar parcialmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(27, 151, 1, 51, 'Recobro en contrato de capitación por servicios prestados por otro prestador', 'Aplica cuando se realizan descuentos al valor a\npagar por concepto de capitación, originados en\nlos pagos de servicios incluidos en el contrato de\ncapitación y que por motivo de atención de\nurgencias, remisión de la IPS contratista o\nimposibilidad de prestarlo, el servicio es\nefectivamente prestado por otro prestador.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(28, 152, 1, 52, 'Disminución en el número de personas incluidas en la capitación', 'Aplica cuando el número de personas incluidas en\nla capitación es disminuido porque una autoridad\ncompetente excluye a algunas de las personas de\nla base de datos de beneficiarios de subsidios.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(29, 154, 1, 54, '<Código y descripción adicionado por el artículo 4 de la Resolución 416 de 2009. El nuevo texto es el siguiente:> Incumplimiento en las metas de cobertura, resolutividad y oportunidad pactadas en el contrato por capitación. <Notas de Vigencia> ', '<Código adicionado por el artículo 6 de la\nResolución 416 de 2009> Aplica cuando el prestador incumple o no demuestra el\ncumplimiento en las metas pactadas en cobertura,\noportunidad y resolutividad pactadas en el contrato\npor capitación. El valor de la glosa, será la\nproporción que se haya acordado, de acuerdo con\nlos criterios de evaluación establecidos en el\nacuerdo de voluntades.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(30, 201, 2, 01, 'Estancia', 'Aplica cuando el cargo por estancia, que viene\nrelacionado y/o justificado en los soportes de la\nfactura, presenta diferencia con los valores que\nfueron pactados o establecidos normativamente,\nvigentes al momento de la prestación del servicio.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(31, 202, 2, 02, 'Consultas, interconsultas y visitas médicas', 'Aplica cuando el cargo por consulta, interconsulta\ny/o visita médica que viene relacionado y/o\njustificado en los soportes de la factura, presenta\ndiferencias con los valores que fueron pactados.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(32, 203, 2, 03, 'Honorarios médicos en procedimientos', '1. Los cargos por honorarios médicos en\nprocedimientos quirúrgicos, de hemodinamia,\nradiología u otros procedimientos que vienen\nrelacionados y/o justificados en los soportes de la\nfactura, presentan diferencias con los valores que\nfueron pactados.\n2. Los cargos por honorarios de anestesia que\nvienen relacionados y/o justificados en los\nsoportes de la factura, presentan diferencias con\nlos valores que fueron pactados, vigentes al\nmomento de la prestación del servicio', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(33, 204, 2, 04, 'Honorarios otros profesionales asistenciales', 'Aplica cuando los cargos por honorarios de los\nprofesionales en salud diferentes a los quirúrgicos\ny clínicos, que vienen relacionados y/o justificados\nen soportes de la factura, presentan diferencias\ncon los valores pactados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(34, 205, 2, 05, 'Derechos de sala', 'Aplica cuando los cargos por derechos de sala\nque vienen relacionados y/o justificados en los\nsoportes de la factura, presentan diferencias con\nlos valores que fueron pactados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(35, 206, 2, 06, 'Materiales', 'Aplica cuando los cargos por materiales que\nvienen relacionados y/o justificados en los\nsoportes de la factura, presentan diferencias con\nlos valores pactados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(36, 207, 2, 07, 'Medicamentos', '<Notas de Vigencia>\nLa Resolución 3385 de 2011 fue expresamente derogada por el artículo 25 de la Resolución 458\nde 2013, "por la cual se unifica el procedimiento de recobro ante el Fondo de Solidaridad y\nGarantía (Fosyga) y se dictan otras disposiciones", publicada en el Diario Oficial No. 48.712 de 22\nde febrero de 2013. Rige a partir del 1o. de octubre de 2013.\n- Código 207 modificado por el artículo 1 de la Resolución 3385 de 2011, publicada en el Diario\nOficial No. 48.159 de 12 de agosto de 2011.\n<Legislación Anterior>\nTexto original de la Resolución 3047 de 2008:\n207. Aplica cuando los cargos por medicamentos que vienen relacionados y/o justificados en los\nsoportes de la factura, presentan diferencias con los valores que fueron pactados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(37, 208, 2, 08, 'Ayudas diagnósticas', 'Aplica cuando los cargos por ayudas diagnósticas\nque vienen relacionados y/o justificados en los\nsoportes de la factura presentan diferencias con\nlos valores pactados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(38, 209, 2, 09, 'Atención integral (caso, conjunto integral de atenciones,paquete o grupo relacionado por diagnóstico)', 'Aplica cuando el prestador de servicios de salud\nregistra en la factura un mayor valor en el cobro\ndel caso, conjunto integral de atenciones, paquete\no grupo relacionado por diagnóstico, o presenta\ncargos detallados cuya sumatoria final resulta\nsuperior a la tarifa pactada. No aplica cuando se\nhaya pactado, o en la normatividad vigente se\nencuentre establecido el cobro adicional de\nservicios que exceden el paquete.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(39, 223, 2, 23, 'Procedimiento o actividad', 'Aplica cuando los cargos por procedimientos o\nactividades que vienen relacionados y/o\njustificados en los soportes de la factura\npresentan diferencias con los valores pactados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(40, 229, 2, 29, 'Recargos no pactados', 'Aplica cuando en la factura se adicionan cobros\nde recargos no pactados previamente entre la\nentidad responsable del pago y el prestador de\nservicios de salud.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(41, 301, 3, 01, 'Estancia', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en los\nsoportes de la factura que evidencian la estancia.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(42, 302, 3, 02, 'Consultas, interconsultas y visitas médicas', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en los\nsoportes de la factura que evidencian la consulta,\ninterconsulta y/o visita médica', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(43, 303, 3, 03, 'Honorarios médicos en procedimientos', '1. Existe ausencia total o parcial, inconsistencia,\nenmendaduras o ilegibilidad en los soportes de la\nfactura que evidencian los honorarios médicos en\nprocedimientos quirúrgicos, de hemodinamia,\nradiología u otros procedimientos que vienen\nrelacionados y/o justificados en los soportes de la\nfactura.\n2. Existe ausencia total o parcial, inconsistencia,\nenmendaduras o ilegibilidad en las soportes de la\nfactura que evidencian los honorarios de\nanestesia que vienen relacionados y/o justificados\nen la factura.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(44, 304, 3, 04, 'Honorarios otros profesionales asistenciales', 'Existe ausencia total o parcial, inconsistencia,\nenmendadoras o ilegibilidad en los soportes de la\nfactura que evidencian las honorarios de los\nprofesionales en salud, diferente a los quirúrgicos\ny clínicos, que vienen relacionados y/o justificados\nen la factura', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(45, 306, 3, 06, 'Materiales <Código adicionado por el artículo 5 de la Resolución 4331 de 2012>', 'Aplica cuando en la descripción quirúrgica no se\nregistran los materiales empleados que sean\nmotivo de cobro adicional a la tarifa establecida\npara el grupo quirúrgico <Código adicionado por el\nartículo 5 de la Resolución 4331 de 2012>', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(46, 307, 3, 07, 'Medicamentos', 'Existe ausencia total o parcial, enmendaduras o\nilegibilidad en la hoja de administración de\nmedicamentos o en el comprobante de recibido\nde medicamentos por parte de los usuarios.\nExiste inconsistencia en los contenidos de la\nfactura o documento equivalente frente a\nrelacionados en la hoja de administración de\nmedicamentos o en el comprobante de recibido\nde medicamentos por parte de los usuarios', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(47, 308, 3, 08, 'Ayudas diagnósticas', 'Existe ausencia total o parcial, inconsistencia,\nenmendaduras o ilegibilidad en los soportes de la\nfactura que evidencian la práctica de ayudas\ndiagnósticas que vienen relacionadas y/o\njustificadas en los soportes de la factura. Incluye\nla ausencia de lectura del profesional\ncorrespondiente, cuando aplica.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(48, 309, 3, 09, 'Atención integral (caso, conjunto integral de atenciones, paquete o grupo relacionado por diagnóstico)', 'Existe ausencia total o parcial, inconsistencia,\nenmendaduras o ilegibilidad en los soportes de la\nfactura que evidencian las actividades adicionales\nal caso, conjunto integral de atenciones, paquete\no grupo relacionado por diagnóstico.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(49, 320, 3, 20, 'Recibo de pago compartido', 'Aplica cuando se le esté cobrando el 100% de la\nfactura. \n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(50, 330, 3, 30, 'Autorización de servicios adicional', 'Aplica cuando no se anexan a la factura los\nsoportes de los bonos, vouchers o vales por\nperiodos de carencia, cuotas moderadoras, de\nrecuperación, copagos, que recibió el prestador\nde servicios de salud.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(51, 331, 3, 31, 'Bonos o vouchers sin firma del paciente, con enmendaduras o tachones', 'Aplica cuando se evidencia que los vouchers o los\nbonos presentan enmendaduras, tachones o no\nse encuentran debidamente firmados por el\npaciente o un acudiente en el caso de\nimposibilidad para firmar, solo aplica en caso de\ncobro del 100% de la factura a la entidad\nresponsable del pago.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(52, 332, 3, 32, 'Detalle de cargos', '1. Existe ausencia total o parcial, inconsistencia,\nenmendaduras o ilegibilidad en los soportes de la\nfactura que evidencian el detalle de cargos, de los\nvalores facturados.\n2. Se anexa detalle de cargos de usuarios\ndiferentes al registrado en la factura.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(53, 333, 3, 33, 'Copia de historia clínica completa', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en la\ncopia de la historia clínica completa para el\nrecobro. Aplica sólo en los eventos de alto costo', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(54, 335, 3, 35, 'Formato accidente de trabajo y enfermedad profesional ATEP', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en el\nformulario del IPAT (Informe del Presunto\nAccidente de Trabajo), en los casos que los\neventos correspondan a un accidente de trabajo o\nenfermedad profesional ATEP. En caso de no\ncontarse con el IPAT, este soporte se sustituye\npor el informe que haga el prestador de servicios\nde salud al asegurador del presunto origen laboral\npara que el asegurador solicite el formulario.\nDecreto 2463/2001 Art. 25.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(55, 336, 3, 36, 'Copia de factura o detalle de cargos del seguro obligatorio de accidentes de tránsito SOAT', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en las\ncopias de las facturas enviadas a la compañía de\nseguros SOAT, al encargo fiduciario de Fosyga\ncon sus respectivos detalles, cumpliendo los\ntopes.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(56, 337, 3, 37, 'Orden o fórmula médica', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en la\norden y/o fórmula médica.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(57, 338, 3, 38, 'Hoja de traslado en ambulancia', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en la\nhoja de traslado.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(58, 339, 3, 39, 'Comprobante de recibido del usuario', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en el\ncomprobante de recibido del usuario como\nevidencia de haber recibido el servicio.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(59, 340, 3, 40, 'Registro de anestesia', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en el\nregistro de anestesia.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(60, 341, 3, 41, 'Descripción quirúrgica', 'Aplica cuando existe ausencia total o parcial,\ninconsistencia, enmendaduras o ilegibilidad en el\nregistro de anestesia.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(61, 342, 3, 42, 'Lista de precios', 'Aplica únicamente cuando no existe contrato\nentre el prestador y el pagador y el prestador\ndebe adjuntar la parte del documento que\nrelaciona los precios de compra del prestador\npara los medicamentos e insumos incluidos en la\nfactura.\nNo aplica en los casos en que existe contrato\nentre el pagador y el prestador ya que esta lista\nde precios debe ser un anexo del contrato, a\nmenos que se requiera actualizar la información.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(62, 343, 3, 43, 'Orden o autorización de servicios vencida', 'No registra informacion', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(63, 401, 4, 01, 'Estancia', '1. El número de horas en observación, o días\nen habitación, que vienen relacionados en la\nfactura presenta diferencia con los días\nautorizados. \n2. El tipo de estancia prestado no\ncorresponde al autorizado.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(64, 402, 4, 02, 'Consultas, interconsultas y visitas médicas', 'Aplica cuando la consulta, interconsulta y/o\nvisita médica relacionada y/o justificada en\nlos soportes de la factura presenta diferencias\ncon lo autorizado.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(65, 403, 4, 03, 'Autorización honorarios médicos en procedimientos Devoluciones<Código adicionado por el artículo 5 de la Resolución 4331 de 2012>', 'Aplica cuando la entidad responsable del\npago emitió autorización directamente al\nprofesional para la ejecución del\nprocedimiento y la Institución Prestadora de\nServicios de Salud está facturando a su\nnombre estos honorarios.<Código 403\nadicionado por el artículo 5 de la Resolución 4331\nde 2012>', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(66, 406, 4, 06, 'Materiales', 'Aplica cuando los materiales que vienen\nrelacionados y/o justificados en los soportes\nde la factura, presentan diferencias con los\nautorizados.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(67, 408, 4, 08, 'Ayudas diagnósticas', 'Aplica cuando las ayudas diagnósticas\nrelacionadas y/o justificados en los soportes\nde la factura presentan diferencias con lo\nautorizado.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(68, 423, 4, 23, 'Procedimiento o actividad', 'Aplica cuando el procedimiento o actividad\nprestada relacionada y/o justificada en los\nsoportes de la factura, difiere de la autorizada.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(69, 430, 4, 30, 'Autorización de servicios adicionales', '<Código modificado por el artículo 8 de la\nResolución 416 de 2009. El nuevo texto es el\nsiguiente:> Aplica cuando existe ausencia\ntotal o parcial, inconsistencia, enmendaduras\no ilegibilidad en los soportes de la factura que\nevidencian la autorización de algunos\nservicios no incluidos en el evento principal\ndel plan de manejo o de la solicitud formulada\noportunamente por el prestador y no\nrespondida en los términos de la presente\nresolución.\nNo aplica cuando durante la realización de un\nprocedimiento quirúrgico debidamente\nautorizado, el cirujano considera necesaria la\nrealización de un procedimiento adicional\nderivado de los hallazgos intraoperatorios,\nsiempre y cuando la conducta asumida\njustifique la realización de dicho\nprocedimiento adicional a la luz de la sana\ncrítica de la auditoría médica.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(70, 438, 4, 38, '<Código y descripción adicionado por el artículo 4 de la Resolución 416 de 2009. El nuevo texto es el siguiente:> Traslado en ambulancia', '<Código adicionado por el artículo 9 de la\nResolución 416 de 2009. El nuevo texto es el\nsiguiente:> Aplica cuando:\n1. El traslado en ambulancia no cuenta con la\nautorización pactada en el acuerdo de\nvoluntades.\n2. No aplica en caso de traslados', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(71, 443, 4, 43, 'Orden o autorización de servicios vencida', '1. La orden o autorización de servicios que se\nanexa como soporte de la factura ha\nsuperado el límite de días de vigencia.\n2. La orden o autorización de servicios que se\nanexa como soporte de la factura ha sido\nreemplazada por solicitud del prestador de\nservicios de salud.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(72, 444, 4, 44, 'Médico que ordena no adscrito <Notas de Vigencia> ', 'Aplica en aquellos casos que se presten\nservicios ordenados por un profesional que\nno hace parte del cuerpo médico de la\nentidad responsable del pago.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(73, 501, 5, 01, 'Estancia', 'Aplica cuando el número de días en\nobservación o habitación, que vienen\nrelacionados en la factura no están\nincluidos en el respectivo plan o hacen\nparte integral de un servicio y se están\ncobrando adicionalmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(74, 502, 5, 02, 'Consultas, interconsultas y visitas médicas', 'Aplica cuando la consulta, interconsulta\ny/o visita médica relacionadas no están\nincluidas en el respectivo plan o hacen\nparte integral de un servicio y se están\ncobrando adicionalmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(75, 506, 5, 06, 'Materiales', 'Aplica cuando los materiales que vienen\nrelacionados y/o justificados en los\nsoportes de la factura, no están incluidos\nen el respectivo plan o hacen parte\nintegral de un servicio y se están\ncobrando adicionalmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(76, 507, 5, 07, 'Medicamentos', 'Aplica cuando los medicamentos\nentregados o relacionados en la hoja de\nsuministro de medicamentos y/o\njustificados en la factura no están\nincluidos en el respectivo plan o hacen\nparte integral de un servicio y se están\ncobrando adicionalmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(77, 508, 5, 08, 'Ayudas diagnósticas', 'Aplica cuando las ayudas diagnósticas\nrelacionadas y/o justificados en los\nsoportes de la factura no están incluidas\nen el respectivo plan o hacen parte\nintegral de un servicio y se están\ncobrando adicionalmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(78, 523, 5, 23, 'Procedimiento o actividad', 'Aplica cuando en la factura se cobra un\nprocedimiento o una actividad que no\nestán incluidos en el respectivo plan ó\nhacen parte integral de un servicio y se\nestán cobrando adicionalmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(79, 527, 5, 27, 'Servicio o procedimiento incluido en otro', 'Aplica cuando se factura por separado un\nprocedimiento incluido en otro ya\nfacturado.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(80, 545, 5, 45, 'Servicio no pactado', 'Aplica cuando en la factura se cobra un\nservicio que no se encuentra establecido\nentre las partes.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(81, 546, 5, 46, 'Cobertura sin agotar en la póliza Seguro obligatorio de accidentes de tránsito (SOAT)', 'Aplica cuando se facturan servicios a la\nentidad responsable del pago sin agotar\nlos topes cubiertos por las pólizas de\nSeguro Obligatorio de accidentes de\ntránsito y el administrador fiduciario de\nFosyga.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(82, 601, 6, 01, 'Estancia', 'Aplica cuando el cargo por estancia, sea\nesta en observación o, habitación, que\nviene relacionado en los soportes de la\nfactura, no es pertinente o no tiene\njustificación médica para el cobro', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(83, 602, 6, 02, 'Consultas, interconsultas y visitas médicas', 'Aplica cuando el cargo por consulta,\ninterconsulta y/o visita médica que viene\nrelacionado en los soportes de la factura,\nno es pertinente o no tiene justificación\nmédica para el cobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(84, 603, 6, 03, 'Honorarios médicos en procedimientos', '1. Los cargos por honorarios médicos en\nprocedimientos quirúrgicos, de\nhemodinamia, radiología u otros\nprocedimientos que vienen relacionados\nen los soportes de la factura no son\npertinentes o no tienen justificación\nmédica para el cobro.\n2. Los cargos por honorarios de\nanestesia que vienen relacionados en los\nsoportes de la factura no son pertinentes\no no tienen justificación médica para el\ncobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(85, 604, 6, 04, 'Honorarios otros profesionales asistenciales', 'Aplica cuando los cargos por honorarios\nde otros profesionales asistenciales\ndiferentes a los quirúrgicos y clínicos, que\nvienen relacionados en los soportes de la\nfactura no son pertinentes o no tienen\njustificación para el cobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(86, 605, 6, 05, 'Derechos de sala', 'Aplica cuando los cargos por derechos\nde sala que vienen relacionados en los\nsoportes de la factura no son pertinentes\no no tienen justificación médica para el\ncobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(87, 606, 6, 06, 'Materiales', 'Aplica cuando los cargos por materiales\nque vienen relacionados en el detalle de\ncargos y/o los soportes pactados no son\npertinentes o no tienen justificación\nmédica para el cobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(88, 607, 6, 07, 'Medicamentos', 'Aplica cuando los cargos por\nmedicamentos que vienen relacionados\nen el detalle de cargos y/o los soportes\npactados no son pertinentes o no tienen\njustificación médica para el cobro.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(89, 608, 6, 08, 'Ayudas diagnósticas', 'Aplica cuando los cargos por ayudas\ndiagnósticas que vienen relacionados en\nlos soportes de la factura no son\npertinentes o no1tienen justificación\nmédica para el cobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(90, 623, 6, 23, 'Procedimiento o actividad', 'Aplica cuando los cargos por\nprocedimientos o actividades que vienen\nrelacionados en los soportes de la factura\nno son pertinentes o no tienen\njustificación médica para el cobro.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(91, 653, 6, 53, 'Urgencia no pertinente ', 'Aplica cuando los servicios prestados no\nobedecen a una atención de urgencia de\nacuerdo con la definición de la\nnormatividad vigente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(92, 816, 8, 16, 'Usuario o servicio corresponde a otro plan o responsable', '1. La factura corresponde a un usuario\nque pertenece a otra entidad responsable\ndel pago.\n2. La factura corresponde a un usuario o\nservicio que pertenece a otro plan de la\nmisma entidad responsable del pago. \n3. La factura corresponde a un servicio\nque debe ser pagado por otra entidad\nresponsable del pago.\nNota: Aplica sólo cuando la factura que\nincluye varios usuarios, no se puede\ntramitar parcialmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(93, 817, 8, 17, 'Usuario retirado o moroso', 'Aplica cuando la factura corresponde a\nun usuario que en el momento de la\nprestación del servicio no está cubierto\npor la entidad responsable del pago o se\nencuentra moroso en el pago.\nNota: Aplica sólo cuando la factura que\nincluye varios usuarios, no se puede\ntramitar parcialmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(94, 821, 8, 21, 'Autorización principal no existe no corresponde al prestador de servicios de salud', 'Aplica cuando se carece de autorización\nprincipal o esta no corresponde al\nprestador de servicios. Cuando la entidad\nresponsable del pago no se haya\npronunciado dentro de los términos\ndefinidos en la normatividad vigente, será\nsuficiente soporte la copia de la solicitud\nenviada a la entidad responsable del\npago, o a la dirección departamental o\ndistrital de salud y en tal caso no aplicará\nesta causa de devolución.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(95, 822, 8, 22, 'Respuesta a glosa o devolución extemporánea Respuesta a Glosa o Devoluciones <Código adicionado por el artículo 5 de la Resolución 4331 de 2012>', 'Aplica cuando la respuesta a la glosa se\npresenta por fuera de los términos\nlegales. <Código 822 adicionado por el\nartículo 5 de la Resolución 4331 de 2012>', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(96, 834, 8, 34, 'Resumen egreso o epicrisis, hoja de atención de urgencias u odontograma', '1. No se anexa a la factura de internación\no de urgencias con observación la\nepicrisis.\n2. Para el caso de facturas de atención\nde urgencias, cuando no se anexa la hoja\nde atención de urgencias.\n3. Para el caso de facturas de atención\nodontológica, cuando no se anexa el\nodontograma.\nNota: Aplica sólo cuando la factura que\nincluye varios usuarios, no se puede\ntramitar parcialmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(97, 844, 8, 44, 'Médico que ordena no adscrito', 'Aplica cuando el profesional que ordena\nel servicio no hace parte del cuerpo\nmédico de la entidad responsable de\npago. No aplica en caso de atención\ninicial de urgencias.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(98, 847, 8, 47, 'Faltan soportes de justificación para recobros (Comité Técnico Científico, (CTC) accidente de trabajo o enfermedad profesional (ATEP), tutelas)', 'Aplica cuando no se incluyen en la\nfactura los soportes de justificación para\nrecobros de comité técnico científico,\ntutelas o accidentes de trabajo o\nenfermedad profesional de conformidad\ncon la normatividad vigente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(99, 848, 8, 48, 'Informe de atención inicial de urgencias', 'Aplica cuando la atención de urgencias\nno es informada a la entidad responsable\ndel pago, en los términos definidos. No\naplica en los casos que no sea posible\nidentificar la entidad responsable de pago\ndentro de los términos establecidos, ni en\naquellos casos en los que se formuló\nsolicitud de autorización para prestación\nde servicios adicionales dentro de las 24\nhoras siguientes al inicio de la atención\ninicial de urgencias. Se consideran\ninformadas aquellas atenciones\ncomunicadas a las direcciones\ndepartamentales y distritales de salud por\nno haberse establecido comunicación\ncon la entidad responsable del pago, en\nlos términos establecidos en la presente\nresolución.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(100, 849, 8, 49, 'Factura no cumple requisitos legales', 'Aplica cuando la factura o el documento\nequivalente a la factura no cumple con\nalguno de los requisitos legales o cuando\nno se identifique en los medicamentos no\nincluidos el Plan Obligatorio de Salud\n(POS) el código CUM, emitido por el\nINVIMA con la siguiente estructura:\nExpediente – Consecutivo – ATC. <Texto\nsubrayado adicionado por el artículo 5 de la\nResolución 4331 de 2012>', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(101, 850, 8, 50, 'Factura ya cancelada', 'Aplica cuando la factura corresponda a\nservicios ya cancelados por la entidad\nresponsable del pago.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(102, 995, 9, 95, 'Glosa o devolución extemporánea <Código adicionado por el artículo 5 de la Resolución 4331 de 2012>', 'Aplica cuando la entidad responsable del\npago comunica la glosa o devolución por\nfuera de los términos legales. <Código\n995 adicionado por el artículo 5 de la\nResolución 4331 de 2012>', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(103, 996, 9, 96, 'Glosa o devolución injustificada', 'Aplica cuando el prestador de servicios\nde salud informa a la entidad\nresponsable del pago que la glosa o\ndevolución es injustificada al 100%.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(104, 997, 9, 97, 'No subsanada (Glosa o devolución totalmente aceptada)[2]', 'Aplica cuando el prestador de servicios\nde salud informa a la entidad\nresponsable del pago que la glosa o\ndevolución ha sido aceptada al 100%', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(105, 998, 9, 98, 'Subsanada parcial (Glosa o devolución parcialmente aceptada)', 'Aplica cuando el prestador de servicios\nde salud informa a la entidad\nresponsable del pago que la glosa o\ndevolución ha sido aceptada\nparcialmente.', '2017-12-19 13:27:59', '0000-00-00 00:00:00'),
(106, 999, 9, 99, 'Subsanada (Glosa o devolución no aceptada)', 'Aplica cuando el prestador de servicios\nde salud informa a la entidad\nresponsable del pago que la glosa o\ndevolución siendo justificada ha podido\nser subsanada totalmente.\n', '2017-12-19 13:27:59', '0000-00-00 00:00:00');
