(11, 'A028', 'OTRAS INFECCIONES ESPECIFICADAS COMO DEBIDAS A SALMONELLA', ' ', '0000-00-00 00:00:00', 0),
(12, 'A029', 'INFECCIÓN DEBIDA A SALMONELLA NO ESPECIFICADA', ' ', '0000-00-00 00:00:00', 0),
(13, 'A030', 'SHIGELOSIS DEBIDA A SHIGELLA DYSENTERIAE', ' ', '0000-00-00 00:00:00', 0),
(14, 'A031', 'SHIGELOSIS DEBIDA A SHIGELLA FLEXNERI', ' ', '0000-00-00 00:00:00', 0),
(15, 'A032', 'SHIGELOSIS DEBIDA A SHIGELLA BOYDII', ' ', '0000-00-00 00:00:00', 0),
(16, 'A033', 'SHIGELOSIS DEBIDA A SHIGELLA SONNEI', ' ', '0000-00-00 00:00:00', 0),
(17, 'A038', 'OTRAS SHIGELOSIS', ' ', '0000-00-00 00:00:00', 0),
(18, 'A039', 'SHIGELOSIS DE TIPO NO ESPECIFICADO', ' ', '0000-00-00 00:00:00', 0),
